-- ----------------------------
-- Procedure structure for queryDtHistoryValid
-- ----------------------------
DROP PROCEDURE IF EXISTS `queryDtHistoryValid`;
delimiter ;;
CREATE PROCEDURE `queryDtHistoryValid`()
BEGIN
SELECT t1.* FROM faults_current AS t1 
INNER JOIN faults_config AS t2 
ON t1.LineNO=t2.LineNO AND t1.DeviceNO=t2.DeviceNO AND t1.FaultNO=t2.FaultNO AND t2.FaultEnable='1';

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for queryDtTitleGridShowMainForm
-- ----------------------------
DROP PROCEDURE IF EXISTS `queryDtTitleGridShowMainForm`;
delimiter ;;
CREATE PROCEDURE `queryDtTitleGridShowMainForm`()
BEGIN

SELECT t1.`NO`,t2.LineName,t3.DeviceName,t4.FaultName,t1.FaultTime FROM 
(
SELECT t1.* FROM faults_current AS t1 
INNER JOIN faults_config AS t2 
ON t1.LineNO=t2.LineNO AND t1.DeviceNO=t2.DeviceNO AND t1.FaultNO=t2.FaultNO AND t2.FaultEnable='1'
)
AS t1 INNER JOIN productionline AS t2 
INNER JOIN device AS t3 
INNER JOIN faults AS t4 
ON t1.LineNO=t2.LineNO AND t1.DeviceNO=t3.DeviceNO AND t1.DeviceNO=t4.DeviceNO AND t1.FaultNO=t4.FaultNO 
ORDER BY t1.`NO`;

END
;;
delimiter ;

